function Records(){
    function doubleIT(num){
        let a= num * 2
        return a
    }
    let numbers=[3,6,8]
    let numbers2= numbers.map(doubleIT)
    return(
        <>
        {numbers}
        <br/>
        {numbers2}
        </>
    )
}
export default Records;
